(4, '3.4', '1', 'PPKN', 'Pengetahuan', '1', 'Mengidentifikasi bentuk kerjasama dalam keberagaman di rumah', 'Tidak Aktif', 0),
(5, '4.1', '1', 'PPKN', 'Keterampilan', '1', 'Menceritakan simbol-simbol sila Pancasila pada Lambang Garuda sila Pancasila', 'Tidak Aktif', 0),
(6, '4.2', '1', 'PPKN', 'Keterampilan', '1', 'Menceritakan kegiatan sesuai dengan aturan yang berlaku dalam kehidupan sehari-hari di rumah', 'Tidak Aktif', 0),
(7, '4.3', '1', 'PPKN', 'Keterampilan', '1', 'Menceritakan pengalaman kebersamaan dalam keberagaman kehidupan individu di rumah', 'Tidak Aktif', 0),
(8, '4.4', '1', 'PPKN', 'Keterampilan', '1', 'Menceritakan pengalaman kerjasama dalam keberagaman di rumah', 'Tidak Aktif', 0),
(9, '3.1', '1', 'B.INDO', 'Pengetahuan', '1', 'Menjelaskan kegiatan persiapan membaca permulaan (cara duduk wajar dan baik, jarak antara mata dan buku, cara memegang buku, cara membalik halaman buku, gerakan mata dari kiri ke kanan, memilih tempat dengan cahaya yang terang, dan etika membaca buku) dengan cara yang benar', 'Tidak Aktif', 0),
(10, '3.2', '1', 'B.INDO', 'Pengetahuan', '1', 'Mengemuka-kan kegiatan persiapan menulis permulaan (cara duduk, cara memegang pensil, cara menggerakkan pensil, cara meletakkan buku, jarak antara mata dan buku, pemilihan tempat dengan cahaya yang terang) yang benar secara lisan', 'Tidak Aktif', 0),
(11, '3.3', '1', 'B.INDO', 'Pengetahuan', '1', 'Menguraikan lambang bunyi vokal dan konsonan dalam kata bahasa Indonesia atau bahasa daerahatau bahasa daerah', 'Tidak Aktif', 0),
(12, '3.4', '1', 'B.INDO', 'Pengetahuan', '1', 'Menentukan kosakata tentang anggota tubuh dan pancaindra serta perawatannya melalui teks pendek (berupa gambar, tulisan, slogan sederhana, dan/atau syair lagu) dan eksplorasi lingkungan', 'Tidak Aktif', 0),
(13, '3.5', '1', 'B.INDO', 'Pengetahuan', '1', 'Mengenal kosakata tentang cara memelihara kesehatan melalui teks pendek (berupa gambar, tulisan, dan slogan sederhana) dan/atau eksplorasi lingkungan.', 'Tidak Aktif', 0),
(14, '3.6', '1', 'B.INDO', 'Pengetahuan', '1', 'Menguraikan kosakata tentang berbagai jenis benda di lingkungan sekitar melalui teks pendek (berupa gambar, slogan sederhana, tulisan, dan/atau syair lagu) dan/atau eksplorasi lingkungan.', 'Tidak Aktif', 0),
(15, '3.7', '1', 'B.INDO', 'Pengetahuan', '1', 'Menentukan kosakata yang berkaitan dengan peristiwa siang dan malam melalui teks pendek (gambar, tulisan, dan/atau syair lagu) dan/atau eksplorasi lingkungan.', 'Tidak Aktif', 0),
(16, '3.8', '1', 'B.INDO', 'Pengetahuan', '1', 'Merinci ungkapan penyampaian terima kasih, permintaan maaf, tolong, dan pemberian pujian, ajakan, pemberitahuan, perintah, dan petunjuk kepada orang lain dengan menggunakan bahasa yang santun secara lisan dan tulisan yang dapat dibantu dengan kosakata bahasa daerah', 'Tidak Aktif', 0),
(17, '3.9', '1', 'B.INDO', 'Pengetahuan', '1', 'Merinci kosakata dan ungkapan perkenalan diri, keluarga, dan orang-orang di tempat tinggalnya secara lisan dan tulis yang dapat dibantu dengan kosakata bahasa daerah', 'Tidak Aktif', 0),
(18, '3.1', '1', 'B.INDO', 'Pengetahuan', '1', 'Menguraikan kosakata hubungan kekeluargaan melalui gambar/bagan silsilah keluarga dalam bahasa Indonesia atau bahasa daerah', 'Tidak Aktif', 0),
(19, '3.11', '1', 'B.INDO', 'Pengetahuan', '1', 'Mencermati puisi anak/syair lagu (berisi ungkapan kekaguman, kebanggaan, hormat kepada orang tua, kasih sayang, atau persahabatan) yang diperdengarkan dengan tujuan untuk kesenangan', 'Tidak Aktif', 0),
(20, '4.1', '1', 'B.INDO', 'Keterampilan', '1', 'Mempraktikkan kegiatan persiapan membaca permulaan (duduk wajar dan baik, jarak antara mata dan buku, cara memegang buku, cara membalik halaman buku, gerakan mata dari kiri ke kanan, memilih tempat dengan cahaya yang terang) dengan benar', 'Tidak Aktif', 0),
(21, '4.2', '1', 'B.INDO', 'Keterampilan', '1', 'Mempraktikkan kegiatan persiapan menulis permulaan (cara duduk, cara memegang pensil, cara meletakkan buku, jarak antara mata dan buku, gerakan tangan atas-bawah, kiri-kanan, latihan pelenturan gerakan tangan dengan gerakan menulis di udara/pasir/ meja, melemaskan jari dengan mewarnai, menjiplak, menggambar, membuat garis tegak, miring, lurus, dan lengkung, menjiplak berbagai bentuk gambar, lingkaran, dan bentuk huruf di tempat bercahaya terang) dengan benar', 'Tidak Aktif', 0),
(22, '4.3', '1', 'B.INDO', 'Keterampilan', '1', 'Melafalkan bunyi vokal dan konsonan dalam kata bahasa Indonesia atau bahasa daerah', 'Tidak Aktif', 0),
(23, '4.4', '1', 'B.INDO', 'Keterampilan', '1', 'Menyampaikan penjelasan (berupa gambar dan tulisan) tentang anggota tubuh dan panca indera serta perawatannya menggunakan kosakata bahasa Indonesia dengan bantuan bahasa daerah secara lisan dan/atau tulis', 'Tidak Aktif', 0),
(24, '4.5', '1', 'B.INDO', 'Keterampilan', '1', 'Mengemukakan penjelasan tentang cara memelihara kesehatan dengan pelafalan kosakata Bahasa Indonesia yang tepat dan dibantu dengan bahasa daerah', 'Tidak Aktif', 0),
(25, '4.6', '1', 'B.INDO', 'Keterampilan', '1', 'Menggunakan kosakata bahasa Indonesia dengan ejaan yang tepat dan dibantu dengan bahasa daerah mengenai berbagai jenis benda di lingkungan sekitar dalam teks tulis sederhana', 'Tidak Aktif', 0),
