(27, '4.8', '1', 'B.INDO', 'Keterampilan', '1', 'Mempraktikan ungkapan terima kasih, permintaan maaf, tolong, dan pemberian pujian, dengan menggunakan bahasa yang santun kepada orang lain secara lisan dan tulis', 'Tidak Aktif', 0),
(28, '4.9', '1', 'B.INDO', 'Keterampilan', '1', 'Menggunakan kosakata dan ungkapan yang tepat untuk perkenalan diri, keluarga, dan orang-orang di tempat tinggalnya secara sederhana dalam bentuk lisan dan tulis', 'Tidak Aktif', 0),
(29, '4.1', '1', 'B.INDO', 'Keterampilan', '1', 'Menggunakan kosakata yang tepat dalam percakapan tentang hubungan kekeluargaan dengan menggunakan bantuan gambar/bagan silsilah keluarga', 'Tidak Aktif', 0),
