(122, 1, 'Pengetahuan', 'B.INDO', NULL, 2165, '80', 'B+', 'Ananda Yumna Nafi\'ah Hamurwani sangat baik dalam merinci kosakata dan ungkapan perkenalan diri, keluarga, dan orang-orang di tempat tinggalnya secara lisan dan tulis yang dapat dibantu dengan kosakata bahasa daerah, kurang baik dalam merinci ungkapan penyampaian terima kasih, permintaan maaf, tolong, dan pemberian pujian, ajakan, pemberitahuan, perintah, dan petunjuk kepada orang lain dengan menggunakan bahasa yang santun secara lisan dan tulisan yang dapat dibantu dengan kosakata bahasa daerah', 0),
(123, 1, 'Pengetahuan', 'B.INDO', NULL, 2166, '84.98', 'A-', 'Ananda Zidane Naufal Alhafizh sangat baik dalam mencermati puisi anak/syair lagu (berisi ungkapan kekaguman, kebanggaan, hormat kepada orang tua, kasih sayang, atau persahabatan) yang diperdengarkan dengan tujuan untuk kesenangan, baik dalam mengenal kosakata tentang cara memelihara kesehatan melalui teks pendek (berupa gambar, tulisan, dan slogan sederhana) dan/atau eksplorasi lingkungan.', 0),
(124, 1, 'Pengetahuan', 'B.INDO', NULL, 2167, '84.52', 'A-', 'Ananda Nathania Kiranaila Hasna Hidayat sangat baik dalam mengemuka-kan kegiatan persiapan menulis permulaan (cara duduk, cara memegang pensil, cara menggerakkan pensil, cara meletakkan buku, jarak antara mata dan buku, pemilihan tempat dengan cahaya yang terang) yang benar secara lisan, kurang baik dalam mengenal kosakata tentang cara memelihara kesehatan melalui teks pendek (berupa gambar, tulisan, dan slogan sederhana) dan/atau eksplorasi lingkungan.', 0),
