(1077, 15, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.2', 0, 'D', 'kurang baik dalam mempraktikkan kegiatan persiapan menulis permulaan (cara duduk, cara memegang pensil, cara meletakkan buku, jarak antara mata dan buku, gerakan tangan atas-bawah, kiri-kanan, latihan pelenturan gerakan tangan dengan gerakan menulis di udara/pasir/ meja, melemaskan jari dengan mewarnai, menjiplak, menggambar, membuat garis tegak, miring, lurus, dan lengkung, menjiplak berbagai bentuk gambar, lingkaran, dan bentuk huruf di tempat bercahaya terang) dengan benar'),
(1078, 15, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.3', 0, 'D', 'kurang baik dalam melafalkan bunyi vokal dan konsonan dalam kata bahasa indonesia atau bahasa daerah'),
(1079, 15, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.4', 0, 'D', 'kurang baik dalam menyampaikan penjelasan (berupa gambar dan tulisan) tentang anggota tubuh dan panca indera serta perawatannya menggunakan kosakata bahasa indonesia dengan bantuan bahasa daerah secara lisan dan/atau tulis'),
(1080, 16, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.6', 0, 'D', 'kurang baik dalam menggunakan kosakata bahasa indonesia dengan ejaan yang tepat dan dibantu dengan bahasa daerah mengenai berbagai jenis benda di lingkungan sekitar dalam teks tulis sederhana'),
(1081, 16, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.7', 0, 'D', 'kurang baik dalam menyampaikan penjelasan dengan kosakata bahasa indonesia dan dibantu dengan bahasa daerah mengenai peristiwa siang dan malam dalam teks tulis dan gambar'),
(1082, 16, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.8', 0, 'D', 'kurang baik dalam mempraktikan ungkapan terima kasih, permintaan maaf, tolong, dan pemberian pujian, dengan menggunakan bahasa yang santun kepada orang lain secara lisan dan tulis'),
(1083, 16, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.9', 0, 'D', 'kurang baik dalam menggunakan kosakata dan ungkapan yang tepat untuk perkenalan diri, keluarga, dan orang-orang di tempat tinggalnya secara sederhana dalam bentuk lisan dan tulis'),
(1084, 16, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.1', 0, 'D', 'kurang baik dalam mempraktikkan kegiatan persiapan membaca permulaan (duduk wajar dan baik, jarak antara mata dan buku, cara memegang buku, cara membalik halaman buku, gerakan mata dari kiri ke kanan, memilih tempat dengan cahaya yang terang) dengan benar'),
(1085, 16, '1', 'Keterampilan', 2167, '0000-00-00', 'B.INDO', '4.11', 0, 'D', 'kurang baik dalam melisankan puisi anak atau syair lagu (berisi ungkapan kekaguman, kebanggaan, hormat kepada orang tua, kasih sayang, atau persahabatan) sebagai bentuk ungkapan diri');
